import hashlib




e = 65537

def modpow(b, e, m):  
    result = 1
    while (e > 0):
        if e & 1:
            result = (result * b) % m
        e = e >> 1
        b = (b * b) % m
    return result
	
	
	
def rsa(data, n):  
    result = modpow(data, e, n)
    return result

